import React from 'react';
import {Add,Sub,mult,div} from './Calc';
import Card from "./Card";


const netimg = "https://www.fillmurray.com/640/360";
    const titleN = "Dark";
    const titleS = "Web Series 1";
    const linkN = "https://www.fillmurray.com/640/360";
    const altN = "Netflix img 1";





function App(){
return(
    <>
    <div className = "main_box">
        
        <div className = "leftDiv">
        <h1 className = "heading">Netflix Series</h1>
            <Card />
            <Card />    
            <Card />    
            <Card />            
        </div>
        <div className = "rightDiv"> 
        <h1 className = "heading">Calculate Amount</h1>           
            <h2>Add : {Add(60,4)}</h2>
            <h2>sub : {Sub(60,4)}</h2>
            <h2>mult : {mult(60,4)}</h2>
            <h2>div: {div(60,3.5)}</h2>
        </div>
    </div>
    </>
);
}

export default App;
